import React from "react";
import axios from "axios";

export default class UserPage extends React.Component {
  state = {
    data: null,
  };

  componentDidMount() {
    let token = "basaramadık";
    if (localStorage.getItem("login") != null) {
      token = "Bearer " + JSON.parse(localStorage.getItem("login")).data;
    } else {
      console.log("not logged in");
    }
    console.log(token);
    axios.get("http://localhost:8080/hello-user", {
      headers: new Headers({
        'Authorization':'Bearer eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiJ1c2VyIiwiaXNVc2VyIjp0cnVlLCJleHAiOjE2MTY1MDM2NDAsImlhdCI6MTYxNjQ4NTY0MH0.Gil2tm6WVbVoM0lF5xQHVrCe2r5LThXgmJ0qvZdBBQvvnADyXaz1T6_BRQAZetyfIKSL0jzTsY0fHye28wb-zg',
        'Content-Type': 'application/json'
      }),
    })
      .then((res) => {
        console.log("then");
        res.json().then((res) => {
          console.log("result:", res);
          this.setState({
            data: res,
          });
        });
      })
      .catch((error) => console.log("Error detected: " + error));
  }

  render() {
    return (
      <div>
        User page
        <div>
          Data: {this.state.data ? this.state.data : <div>nothing</div>}
        </div>
      </div>
    );
  }
}
